import React from 'react'
import { A } from 'hookrouter'


export default function Navbar () {
    return (
        <div>
            <nav className="navbar navbar-light bg-light">
                <span class="navbar-brand mb-0 h1">Social</span>
                <A href="/LoginForm"></A>
            </nav>
        </div>
    )
}
